import React, { Component } from 'react';
import Banner from '../../components/Banner'
import Secao from '../../components/Secao'

import './styles.css'

import imgDados from '../../img/dados.jpg'
import imgPortfolio from '../../img/resumo-portfolio.jpg'
import imgContato from '../../img/resumo-contato.jpg'
import imgBlog from '../../img/resumo-blog.jpg'

export default class Sobre extends Component {
	constructor(props) {
		super(props);
	}

	render() {

		return (
			<main>
				<Banner 
					title="Sobre mim"
					description='"Conheça um pouco sobre minha vida acadêmica"'
				/>
				<Secao
					src={imgDados}
					title="Dados"
				>
					<ul>
						<li>Felipe Rocha de Lucena</li>
						<li>Brasileiro, solteiro, 26 anos</li>
						<li>Fatec São Caetnao do Sul</li>
						<li>Segurança da Informação</li>
						<li>3º Semestre</li>
						<li><strong>Objetivo: Estágio em dev Front-end</strong></li>
					</ul>
				</Secao>

				<Secao
					src={imgPortfolio}
					title="Portfolio"
					description="Clique no botão abaixo e conheça meus projetos."
				/>
				<Secao
					src={imgContato}
					title="Contato"
					description="Caso apareça alguma dúvida ou sugestão, não deixe de entrar em contato comigo!"
				/>
			</main>
		);
	}
}
